import React, { Component } from "react";
import TeamMember from "./TeamMember";


class Team extends Component() {
    constructor(){
        super()
        this.state = {
          
        }
    }

    render() { 

        const members = this.state.memberInfo.map ( member => <TeamMember
            key = {member.id}
            img = {member.img} 
            name = {member.name}
            position = {member.position}
            phone = {member.phone}
            email = {member.email}
            web = {member.web}
            />);



        return (
            <div className="row">
                {members}
            </div>
        )
    }
}


export default Team;
